script: |
  super -f text -I q9634.spq | sort > q9634.out

inputs:
  - name: q9634.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE 28 * - 94 * - 26 * - col2 NOT IN ( - col2 - + col1, - col2, + - 66, + ( + col1 ), col1 + col1 + - + col1 * - + col1, - 29 );
  - name: tab1

outputs:
  - name: q9634.out
    data: |
      51	14	96
      85	5	59
      91	47	68
